import React, { useEffect, useState } from 'react';

function App() {
  const [message, setMessage] = useState([{}]);
  useEffect(() => {
    fetch('/')
      .then((res) => res.json())
      .then((data) => setMessage(data))
      .catch((err) => console.log(err));
  }, []);
  return (
    <div>
      <h1>{message}</h1>
    </div>
  );
}

export default App;
